          <div *ngFor="let subtask of item.subtask; trackBy: trackByFnn">
            <div class="table-task__body-task__task__subtask">
              <div class="row">
                <div class="col-4 padding-left-40">
                  Tiêu chí: {{ subtask.subTaskName }}
